import React from "react";

const Attribute = () => {
  return (
    <>
      <h1 contentEditable="false">This is the Attribute page</h1>
      <img src="https://picsum.photos/200/300" alt="lorem img" />
      <img
        src="https://picsum.photos/300/300"
        alt="lorem img"
        className="my class"
      />
      <img
        src="https://picsum.photos/300/310"
        alt="lorem img"
        style={{ border: "2px solid red" }}
      />
    </>
  );
};

export default Attribute;
